export class EvaluationSecrets implements oasis.AbiEncodable {
    public testDataset: EncryptedData;
    public submissions: oasis.Map<string, EncryptedData>;
    public constructor(fields: {
        testDataset: EncryptedData;
        submissions: oasis.Map<string, EncryptedData>;
    }) {
        this.testDataset = fields.testDataset;
        this.submissions = fields.submissions;
    }
    public abiEncode(encoder: oasis.Encoder) {
        oasis.abiEncode(
            EncryptedData as oasis.Schema,
            this.testDataset,
            encoder,
        );
        oasis.abiEncode(
            ['Map', 'string', EncryptedData] as oasis.Schema,
            this.submissions,
            encoder,
        );
    }
    public static abiDecode(decoder: oasis.Decoder): EvaluationSecrets {
        return new EvaluationSecrets({
            testDataset: oasis.abiDecode(
                EncryptedData as oasis.Schema,
                decoder,
            ),
            submissions: oasis.abiDecode(
                ['Map', 'string', EncryptedData] as oasis.Schema,
                decoder,
            ),
        });
    }
}
export module Error {
    export class ParticipantRegistryUnreachable implements oasis.AbiEncodable {
        public constructor() {}
        public abiEncode(encoder: oasis.Encoder) {
            encoder.writeU8(0);
        }
        public static abiDecode(
            decoder: oasis.Decoder,
        ): ParticipantRegistryUnreachable {
            return new ParticipantRegistryUnreachable();
        }
    }
    export class PermissionDenied implements oasis.AbiEncodable {
        public constructor() {}
        public abiEncode(encoder: oasis.Encoder) {
            encoder.writeU8(1);
        }
        public static abiDecode(decoder: oasis.Decoder): PermissionDenied {
            return new PermissionDenied();
        }
    }
    export class SubmissionsClosed implements oasis.AbiEncodable {
        public constructor() {}
        public abiEncode(encoder: oasis.Encoder) {
            encoder.writeU8(2);
        }
        public static abiDecode(decoder: oasis.Decoder): SubmissionsClosed {
            return new SubmissionsClosed();
        }
    }
    export function abiDecode(decoder: oasis.Decoder): Error {
        const variantId = decoder.readU8();
        return (Error as any).VARIANTS[variantId].abiDecode(decoder);
    }
    export const VARIANTS: Function[] = [
        ParticipantRegistryUnreachable,
        PermissionDenied,
        SubmissionsClosed,
    ];
    export function isVariant(obj: any): obj is Error {
        for (const variant of Error.VARIANTS) {
            if (obj instanceof variant) {
                return true;
            }
        }
        return false;
    }
}
export type Error =
    | Error.ParticipantRegistryUnreachable
    | Error.PermissionDenied
    | Error.SubmissionsClosed;
export class CompetitionCompleted implements oasis.AbiEncodable {
    public winner: string;
    public constructor(fields: { winner: string }) {
        this.winner = fields.winner;
    }
    public abiEncode(encoder: oasis.Encoder) {
        oasis.abiEncode('string' as oasis.Schema, this.winner, encoder);
    }
    public static abiDecode(decoder: oasis.Decoder): CompetitionCompleted {
        return new CompetitionCompleted({
            winner: oasis.abiDecode('string' as oasis.Schema, decoder),
        });
    }
    public static async subscribe(
        gateway: oasis.Gateway,
        address: oasis.Address | null,
        topics?: { winner?: string },
    ): Promise<oasis.Subscription<CompetitionCompleted>> {
        const encodedTopics = [
            oasis.encodeEventTopic('string', CompetitionCompleted.name),
        ];
        if (topics?.hasOwnProperty('winner')) {
            encodedTopics.push(oasis.encodeEventTopic('string', topics.winner));
        }
        return gateway.subscribe(
            address,
            encodedTopics,
            async (payload: Uint8Array) => {
                return oasis.abiDecode(CompetitionCompleted, payload);
            },
        );
    }
}
export class PublicState implements oasis.AbiEncodable {
    public userRegistry: oasis.Address;
    public trainDataset: AuthenticatedData;
    public evaluationProgram: AuthenticatedData;
    public endTimestamp: BigInt;
    public constructor(fields: {
        userRegistry: oasis.Address;
        trainDataset: AuthenticatedData;
        evaluationProgram: AuthenticatedData;
        endTimestamp: BigInt;
    }) {
        this.userRegistry = fields.userRegistry;
        this.trainDataset = fields.trainDataset;
        this.evaluationProgram = fields.evaluationProgram;
        this.endTimestamp = fields.endTimestamp;
    }
    public abiEncode(encoder: oasis.Encoder) {
        oasis.abiEncode(
            oasis.Address as oasis.Schema,
            this.userRegistry,
            encoder,
        );
        oasis.abiEncode(
            AuthenticatedData as oasis.Schema,
            this.trainDataset,
            encoder,
        );
        oasis.abiEncode(
            AuthenticatedData as oasis.Schema,
            this.evaluationProgram,
            encoder,
        );
        oasis.abiEncode('u64' as oasis.Schema, this.endTimestamp, encoder);
    }
    public static abiDecode(decoder: oasis.Decoder): PublicState {
        return new PublicState({
            userRegistry: oasis.abiDecode(
                oasis.Address as oasis.Schema,
                decoder,
            ),
            trainDataset: oasis.abiDecode(
                AuthenticatedData as oasis.Schema,
                decoder,
            ),
            evaluationProgram: oasis.abiDecode(
                AuthenticatedData as oasis.Schema,
                decoder,
            ),
            endTimestamp: oasis.abiDecode('u64' as oasis.Schema, decoder),
        });
    }
}
export class Competition {
    public static BYTECODE =
        '';
    private constructor(
        readonly address: oasis.Address,
        private gateway: oasis.Gateway,
    ) {}
    public static async connect(
        address: oasis.Address,
        gateway: oasis.Gateway,
    ): Promise<Competition> {
        return new Competition(address, gateway);
    }
    public static async deploy(
        gateway: oasis.Gateway,
        {
            userRegistry,
            trainDataset,
            testDataset,
            evaluationProgram,
            endTimestamp,
        }: {
            userRegistry: oasis.Address;
            trainDataset: AuthenticatedData;
            testDataset: EncryptedData;
            evaluationProgram: AuthenticatedData;
            endTimestamp: BigInt;
        },
        options?: oasis.DeployOptions,
    ): Promise<Competition> {
        const payload = Competition.makeDeployPayload(
            userRegistry,
            trainDataset,
            testDataset,
            evaluationProgram,
            endTimestamp,
        );
        try {
            const deployedAddr = await gateway.deploy(payload, options);
            return new Competition(deployedAddr, gateway);
        } catch (e) {
            throw e;
        }
    }
    private static makeDeployPayload(
        userRegistry: oasis.Address,
        trainDataset: AuthenticatedData,
        testDataset: EncryptedData,
        evaluationProgram: AuthenticatedData,
        endTimestamp: BigInt,
    ): Buffer {
        const encoder = new oasis.Encoder();
        encoder.writeU8Array(Buffer.from(Competition.BYTECODE, 'base64'));
        return oasis.abiEncode(
            [
                oasis.Address as oasis.Schema,
                AuthenticatedData as oasis.Schema,
                EncryptedData as oasis.Schema,
                AuthenticatedData as oasis.Schema,
                'u64' as oasis.Schema,
            ],
            [
                userRegistry,
                trainDataset,
                testDataset,
                evaluationProgram,
                endTimestamp,
            ],
            encoder,
        );
    }
    public async getPublicState(
        options?: oasis.RpcOptions,
    ): Promise<PublicState> {
        const payload = Competition.makeGetPublicStatePayload();
        try {
            const res = await this.gateway.rpc(this.address, payload, options);
            return oasis.abiDecode(PublicState as oasis.Schema, res);
        } catch (e) {
            throw e;
        }
    }
    private static makeGetPublicStatePayload(): Buffer {
        const encoder = new oasis.Encoder();
        encoder.writeU8(0);
        return encoder.finish();
    }
    public async submit(
        {
            participantAuthToken,
            model,
        }: { participantAuthToken: string; model: EncryptedData },
        options?: oasis.RpcOptions,
    ): Promise<void> {
        const payload = Competition.makeSubmitPayload(
            participantAuthToken,
            model,
        );
        try {
            const res = await this.gateway.rpc(this.address, payload, options);
            return;
        } catch (e) {
            if (e instanceof oasis.RpcError.Execution) {
                throw oasis.abiDecode(Error as oasis.Schema, e[0]);
            }
            throw e;
        }
    }
    private static makeSubmitPayload(
        participantAuthToken: string,
        model: EncryptedData,
    ): Buffer {
        const encoder = new oasis.Encoder();
        encoder.writeU8(1);
        return oasis.abiEncode(
            ['string' as oasis.Schema, EncryptedData as oasis.Schema],
            [participantAuthToken, model],
            encoder,
        );
    }
    public async beginEvaluation(
        { attestation }: { attestation: AttestationReport },
        options?: oasis.RpcOptions,
    ): Promise<EvaluationSecrets> {
        const payload = Competition.makeBeginEvaluationPayload(attestation);
        try {
            const res = await this.gateway.rpc(this.address, payload, options);
            return oasis.abiDecode(EvaluationSecrets as oasis.Schema, res);
        } catch (e) {
            if (e instanceof oasis.RpcError.Execution) {
                throw oasis.abiDecode(Error as oasis.Schema, e[0]);
            }
            throw e;
        }
    }
    private static makeBeginEvaluationPayload(
        attestation: AttestationReport,
    ): Buffer {
        const encoder = new oasis.Encoder();
        encoder.writeU8(2);
        return oasis.abiEncode(
            [AttestationReport as oasis.Schema],
            [attestation],
            encoder,
        );
    }
    public async announceWinner(
        {
            attestation,
            winner,
        }: { attestation: AttestationReport; winner: string },
        options?: oasis.RpcOptions,
    ): Promise<void> {
        const payload = Competition.makeAnnounceWinnerPayload(
            attestation,
            winner,
        );
        try {
            const res = await this.gateway.rpc(this.address, payload, options);
            return;
        } catch (e) {
            if (e instanceof oasis.RpcError.Execution) {
                throw oasis.abiDecode(Error as oasis.Schema, e[0]);
            }
            throw e;
        }
    }
    private static makeAnnounceWinnerPayload(
        attestation: AttestationReport,
        winner: string,
    ): Buffer {
        const encoder = new oasis.Encoder();
        encoder.writeU8(3);
        return oasis.abiEncode(
            [AttestationReport as oasis.Schema, 'string' as oasis.Schema],
            [attestation, winner],
            encoder,
        );
    }
}
